import React from 'react';
import headshot from '../assets/headshot.JPG'; // Import your headshot image

const Profile = () => {
    return (
        <div style={styles.container}>
            <div style={styles.profileSection}>
                {/* Profile Image */}
                <img src={headshot} alt="Profile" style={styles.image} />

                {/* Text Section */}
                <div style={styles.textSection}>
                    {/* Hello with Line */}
                    <div style={styles.helloSection}>
                        <span style={styles.helloText}>Hello,</span>
                        <div style={styles.line}></div>
                    </div>

                    {/* Large Text */}
                    <p style={styles.bodyText}>
                        I'm Chase, a sophomore at NYU studying Mathematics and Computer Science. Scroll down
                    </p>
                </div>
            </div>
        </div>
    );
};

const styles = {
    container: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        //padding: '50px',
        minHeight: '100vh',
        backgroundColor: '#f4f4f4',
    },
    profileSection: {
        display: 'flex',
        alignItems: 'center',
        width: '80%',
        maxWidth: '1200px',
    },
    image: {
        width: '150px', // Set a fixed size for the image
        height: '150px',
        objectFit: 'cover', // Ensures the image covers the container
        marginRight: '20px', // Space between the image and text
    },
    textSection: {
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
    },
    helloSection: {
        display: 'flex',
        alignItems: 'center',
        marginBottom: '20px',
    },
    helloText: {
        fontSize: '1.5rem',
        fontWeight: 'bold',
        color: '#333',
        marginRight: '10px',
    },
    line: {
        flex: 1,
        height: '2px',
        backgroundColor: '#333',
    },
    bodyText: {
        fontSize: '1.5rem',
        color: '#333',
    },
};

export default Profile;
